腮红很可爱，使用还行，上色慢，适合新手练涂，不会一下猴屁股。
       但是，其他体验感很差！！！买的双拼腮红我自己没拆，封口从快递箱拿出来就开了，不知道是不是别人的退换货品。
       送的杯子漏水，严重漏水！很难拧好，而且不管拧多紧，前两三次躺平都漏水！每次拧开都会在杯子周围撒一圈水&hellip;&hellip;

